import React from 'react';

function Topbar() {
  return (
    <div>
      const currnDate = new Date().toLocaleDateString();
      <section id='topBar_section'>
        <div className='date'>
          <h3>{currnDate}</h3>
        </div>
      </section>
    </div>
  );
}

export default Topbar;
